क्या आप फेसबुक मैसेंजर का इस्तेमाल करते हैं?

अपनी आंखों को आराम देना चाहते हैं और उस वेबसाइट को अंधेरे मोड में उपयोग करना चाहते हैं? {{}

इस एक्सटेंशन को इंस्टॉल करने के बाद आप messenger.com पर डार्क मोड का आनंद ले सकते हैं। {{}

जब आप Messenger.com पर हों, तो हमारे सॉफ़्टवेयर एक्सटेंशन को इंस्टॉल करें और डार्क मोड ऑन / ऑफ करें। {२}

अस्वीकरण: कृपया ध्यान दें कि यह एक्सटेंशन Google द्वारा नहीं बनाया गया है और यह एक स्वतंत्र विकास दल द्वारा बनाया गया है। समस्त कॉपीराइट उनके संबंधित स्वामियों की संपत्ति हैं।
Google इस एक्सटेंशन का समर्थन या प्रायोजन नहीं करता है। मैसेंजर के लिए डार्क मोड स्वामित्व में नहीं है, इसके द्वारा लाइसेंस प्राप्त नहीं है और यह Google इंक की सहायक कंपनी नहीं है।
